import React, { useState, useEffect } from "react"

export const ConditionChecking = () => {
    const [status, setstatus] = useState(1)
    useEffect(() => {
        if (status === 1) {
            console.log(x, y, "1st console")
            var x = 10;
            var y = 20;
            console.log(x, y, "2nd console")
            function getRes() {
                console.log(x, y, "3rd console")
                x = 20;
                var y = 10;
                console.log(x, y, "4th console")
            }
            getRes()
        }
        else if (status === 2) {
            console.log(1 === "1", `1==="1", console 1`)
            console.log(1 == "1", `1=="1", console 2`)
            console.log(null == undefined, "null==undefined , console 3")
        }
    }, [])

    return (
        <div>
            kumar Madhu
            Condition Checking
        </div>
    )
}
